import React, { useState } from 'react';
import './buttons.css';
import { useHistory } from 'react-router-dom';

function Buttons() {
  const history = useHistory();

  const handleSignInClicked = () => {
    history.push('/login');
  };

  const handleSignUpClicked = () => {
    history.push('/signup');
  };

  return (
    <React.Fragment>
      <button className="sign-in" onClick={handleSignInClicked}>
        Sign in
      </button>
      <button className="getting-started" onClick={handleSignUpClicked}>
        Getting Started
      </button>
    </React.Fragment>
  );
}

export default Buttons;
